import React from 'react';

const LayerLibrary: React.FC = () => {
    const layers = [
        { type: 'InputLayer', name: 'Input Layer', icon: '', color: '#455c53ff' },
        { type: 'Conv2DLayer', name: 'Conv2D Layer', icon: '', color: '#455c53ff' },
        { type: 'LinearLayer', name: 'Linear Layer', icon: '', color: '#455c53ff' },
        { type: 'FlattenLayer', name: 'Flatten Layer', icon: '', color: '#455c53ff' },
        { type: 'OutputLayer', name: 'Output Layer', icon: '', color: '#455c53ff' },
        { type: 'ConcatLayer', name: 'Concat Layer', icon: '', color: '#455c53ff' },
    ];

    const handleDragStart = (e: React.DragEvent, layerType: string) => {
        const layerData = {
            type: layerType,
            id: Date.now() + Math.random()
        };
        e.dataTransfer.setData('text/plain', JSON.stringify(layerData));
    };

    return (
        <div style={{
            width: '250px',
            backgroundColor: '#151515ff',
            padding: '16px',
            borderRight: '0px solid #000000ff',
            height: '100%',
            overflowY: 'auto'
        }}>
            <h3 style={{ 
                color: '#ffffff', 
                marginTop: 0, 
                marginBottom: '16px',
                fontSize: '18px'
            }}>
                Layer Library
            </h3>

            <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                {layers.map((layer) => (
                    <div
                        key={layer.type}
                        draggable
                        onDragStart={(e) => handleDragStart(e, layer.type)}
                        style={{
                            padding: '12px',
                            backgroundColor: '#151515ff',
                            border: `2px solid ${layer.color}`,
                            borderRadius: '8px',
                            cursor: 'grab',
                            transition: 'all 0.2s ease',
                            display: 'flex',
                            alignItems: 'center',
                            gap: '12px'
                        }}
                        onMouseDown={(e) => e.currentTarget.style.cursor = 'grabbing'}
                        onMouseUp={(e) => e.currentTarget.style.cursor = 'grab'}
                        onMouseOver={(e) => {
                            e.currentTarget.style.backgroundColor = '#151515ff';
                            e.currentTarget.style.transform = 'translateY(-2px)';
                        }}
                        onMouseOut={(e) => {
                            e.currentTarget.style.backgroundColor = '#3a3a3a';
                            e.currentTarget.style.transform = 'translateY(0)';
                        }}
                    >
                        <span style={{ fontSize: '20px' }}>{layer.icon}</span>
                        <span style={{ 
                            color: '#151515ff', 
                            fontWeight: '500',
                            fontSize: '14px'
                        }}>
                            {layer.name}
                        </span>
                    </div>
                ))}
            </div>

            <div style={{
                marginTop: '24px',
                padding: '12px',
                backgroundColor: '#1a1a1a',
                borderRadius: '6px',
                border: '1px solid #555'
            }}>
                <h4 style={{ 
                    color: '#ccc', 
                    margin: '0 0 8px 0',
                    fontSize: '14px'
                }}>
                    How to use:
                </h4>
                <ul style={{ 
                    color: '#888', 
                    fontSize: '12px',
                    margin: 0,
                    paddingLeft: '16px'
                }}>
                    <li>Drag layers to canvas</li>
                    <li>Click red dot â†’ green dot to connect</li>
                    <li>Edit parameters inline</li>
                    <li>Delete with Del/Backspace</li>
                </ul>
            </div>
        </div>
    );
};

export default LayerLibrary;
